import React from 'react';
import PropTypes from 'prop-types';

const HeaderForm = props => {
    return (
        <div className="formHeader">
           <div>
            <label>Tittle</label>
            <input type="text"/> 
            </div>
           <div>
            <label>Ar</label>
            <input type="text" /> 
            </div>
           <div>
            <label> title</label>
            <input type="text"/> 
            </div>
        </div>
    );
};

HeaderForm.propTypes = {
    
};

export default HeaderForm;
